import React from 'react';
import Kartya from './Kartya';
import adatok from '../adatok';
import './Galeria.css';

const Galeria = () =>{
    return(
        <>
        {adatok.map((adat) => (
        <Kartya
            key={adat.id}
            cim={adat.cim}
            kep={adat.kep}
            leiras={adat.leiras}
        />
    ))}
    </>
    );
};

export default Galeria;
